import './header.css'
function Header(){
    return(
        <header className='header'>
            <div className='container'>
                <div className='header__row'>
                    <div className='header__logo'>QPICK</div>
                    <div className='header__icons'></div>
                </div>
            </div>
        </header>
    )
}
export default Header;
